render() {
  return (
    <form className={classes.root} autoComplete="off">
      <div>
        <TextField
          id="asset_name"
          label="Asset Name"
          variant="outlined"
          //value={assetName}
          //onChange={handleNameChange}
        />

        <TextField
          id="interest_rate"
          label="Asset Interest Rate"
          type="number"
          variant="outlined"
          //value={interestRate}
          //onChange={handleInterestChange}
        />
        <TextField
          id="current_value"
          label="Current Value"
          type="number"
          variant="outlined"
          //value={currentValue}
          //onChange={handleValueChange}
        />
        <Button variant="contained" color="primary" >
          Add this asset
        </Button>
      </div>
    </form>
  );
}
}

 export default FormPropsTextFields;
